	this.vol_up.name = "vol_up";
	this.vol_up.parent = this;
	this.vol_up.setTransform(-24.7,5.6,1,1,0,0,0,9,7);
	new cjs.ButtonHelper(this.vol_up, 0, 1, 2, false, new lib.vol_pos(), 3);

